import { PanelMenu } from 'primereact/panelmenu';


const Location = () => {
    const items: object[] = [
        {
           label:'Locations',
           icon:'pi pi-fw pi-globe',
           items:[
              {
                 label:'New',
                 icon:'pi pi-fw pi-plus',
              },
              {
                 label:'Delete',
                 icon:'pi pi-fw pi-trash'
              },
           ]
        }
     ];

    return ( 
        <>
            <PanelMenu/>
        </>
     );
}


export default Location;
